import heapq

def minPath(grid, k):
    rows, cols = len(grid), len(grid[0])
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    queue = []
    for i in range(rows):
        for j in range(cols):
            heapq.heappush(queue, (grid[i][j], i, j))

    result = []
    for _ in range(k):
        val, x, y = heapq.heappop(queue)
        result.append(val)
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < rows and 0 <= ny < cols:
                heapq.heappush(queue, (grid[nx][ny], nx, ny))

    return result

